import React from "react";
import { NavLink, Link, withRouter } from "react-router-dom";
const Nav = () => {
    return (
        <div id="nav">

        <NavLink

          activeClassName="selected"
          activeStyle={{ textDecoration: "none" }}
          to="/">
          Home
        </NavLink>
        <NavLink
          data-dd-action-name="home-nav-link"
          activeStyle={{ textDecoration: "none" }}
          to="/counter">
          Counter
        </NavLink>
        </div>
    )
}
export default Nav;
